import React from 'react';
import Home from "./components/pages/Home";
import { Route, Routes } from "react-router-dom";
import './components/pages/Home.css';

function App() {
  return (
    <>
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </>
  );
}

export default App;
